import { Row, Col, Container } from "react-bootstrap";
import "../styling/collections.css";
import rosebud from "../assets/categories/rosebud-collection.jpg";
import fairytale from "../assets/categories/forgetmenot.jpg";
import pastel from "../assets/categories/pastel.jpg";

export const Collections = () => {
  return (
    <div className="collection-container">
      <h1>Collections</h1>
      <Container fluid>
        <Row>
          {collectionData.map((item) => {
            return (
              <Col xs={12} md={6}>
                <div className="category">
                  <img src={item.image} alt="rings" className="img-fluid" />
                  <h3>{item.name}</h3>
                </div>
              </Col>
            );
          })}
        </Row>
      </Container>
    </div>
  );
};

const collectionData = [
  {
    id: 1,
    name: "Blooming Rosebud",
    image: rosebud,
  },
  {
    id: 2,
    name: "Fairytale",
    image: fairytale,
  },
  {
    id: 3,
    name: "Pastel Dreams",
    image: pastel,
  },
];
